const charArray = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'

function getCellName(row, col) {
    let colName = ''
    while (col >= 26) {
        let number = col % 26
        colName = charArray[number] + colName
        col = parseInt((col - number) / 26, 10) - 1
    }
    colName = charArray[col] + colName
    return colName + (row + 1)
}

